(() => {
  function solve(input) {
    var lines = Utils.read(input);
    var word = lines[0];
    var min = Infinity;
    word = minimize(word);

    for (var n = "a".charCodeAt(0); n <= "z".charCodeAt(0); n++) {
      var word2 = [];
      var char = String.fromCharCode(n);
      for (var i = 0; i < word.length; i++) {
        var char2 = word[i];
        if (char2 != char && char2 != char.toUpperCase()) word2 += char2;
      }
      var length = minimize(word2).length;
      if (length < min) min = length;
    }

    return min;
  }

  function minimize(word) {
    var found = true;

    while (found) {
      found = false;
      for (var i = 0; i < word.length - 1; i++) {
        var char = word[i];
        var char2 = word[i + 1];
        if (
          (char == char.toUpperCase() &&
            char2 == char2.toLowerCase() &&
            char == char2.toUpperCase()) ||
          (char2 == char2.toUpperCase() &&
            char == char.toLowerCase() &&
            char2 == char.toUpperCase())
        ) {
          found = true;
          word = word.substring(0, i) + word.substring(i + 2);
          i--;
        }
      }
    }
    return word;
  }

  var dataset = [];

  dataset.push({
    input: `dabAcCaCBAcCcaDA`,
    output: 4
  });

  dataset.push({
    input: ``,
    output: 4556
  });

  Utils.check(solve, dataset, "5b");
})();
